// Definition modules for importing png|svg|jpg|gif
declare module '*.png' {
  const content: any;
  export = content;
}
declare module '*.svg' {
  const content: any;
  export = content;
}
declare module '*.jpg' {
  const content: any;
  export = content;
}
declare module '*.gif' {
  const content: any;
  export = content;
}
